SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE VIEW [dbo].[ClientServiceView]
AS
SELECT        dbo.ClientService.Id, dbo.Client.LastName + ' ' + LEFT(dbo.Client.FirstName, 1) + '. ' + LEFT(dbo.Client.Patronymic, 1) + '.' AS ClientInfo, dbo.Employee.LastName + ' ' + LEFT(dbo.Employee.FirstName, 1) 
                         + '. ' + LEFT(dbo.Employee.Patronymic, 1) + '.' AS EmployeeInfo, dbo.Service.Name AS Service, dbo.Service.Cost, dbo.ClientService.Date
FROM            dbo.ClientService INNER JOIN
                         dbo.Client ON dbo.ClientService.ClientId = dbo.Client.Id INNER JOIN
                         dbo.Employee ON dbo.ClientService.EmployeeId = dbo.Employee.Id INNER JOIN
                         dbo.Service ON dbo.ClientService.ServiceId = dbo.Service.Id
